import Axios from "axios"
import { useEffect, useState } from 'react'
import { useLocation, useParams } from 'react-router-dom'

function TrainingFeedbackManagement(){
    const location = useLocation()
    const {denumire, data, speaker} = location.state
    let { id } = useParams()

    const [tema, setTema] = useState([])

    useEffect(() => {
        getFeedback()
      }, [])

    const getFeedback = () => {
        Axios.get(`http://localhost:3001/api/training/${id}`).then(response => {
            const feedback = response.data
            console.log(response.data)
            let tema = feedback.map(f => f.tema)
            setTema(tema)
            // console.log(tema)
        })
        .catch(err => console.log(err))
    }
    const listTemaFb = tema.map(f =>
    <li key={f.id}>
            {f}
    </li>
);

    return(
        <>
            <h1>{denumire}</h1>
            <h3>{data}</h3>
            <h2>{speaker}</h2>
            <ul>{listTemaFb}</ul>
        </>
    )
}

export default TrainingFeedbackManagement
